import React from "react";
import "./style.css";

function Navbar() {
  return (
    <div className="navbar">
      <div className="container">
        <div className="nav-left">
          <div className="logo">logo</div>
        </div>
        <div className="nav-right">
          <div className="user-counter">Users: </div>
        </div>
      </div>
    </div>
  );
}

export default Navbar;
